//import { Link} from "react-router-dom";
//import Button from '../components/button';
//import ProductHero from '../components/productHero.js';

import Propaganda from "../images/propaganda.png";
import Typography from '../components/Typography';
import "../styles/home.css";




const Home = () => {
    return (
      <>
          <div class="container">
            
          <img src={Propaganda}  width="30%" alt="increase priority"style={{
            position: 'relative',
            right:'10%',
            bottom:'15%'
                    }} />
      <div class="text">
        <h1>Propaganda</h1>
      </div>
    </div>
      
     
    </>
    );
  };
  
  export default Home;
